import React from "react";

const Personalized_data_ProfileSection = (props) => {
        
        switch(typeof props.id){
            
            case ('object'):
                const UserData = props.id
                
                return <React.Fragment>

                <div>
                    <p>Profile</p>
                    <img src="https://img1.daumcdn.net/thumb/R1280x0/?scode=mtistory2&fname=https%3A%2F%2Fblog.kakaocdn.net%2Fdn%2FDLdOQ%2Fbtq6ske4ggI%2FKuvXII8GfaMFvdpE240Dy0%2Fimg.png"></img>
                    <p>{UserData.firstName}</p>
                </div>

            

            </React.Fragment>

            case (`undefined`): return;

        }

    }

export default Personalized_data_ProfileSection;
